import Link from "next/link";
import Head from "next/head";

export default () => (
  <div>
    <h1>Cv Page</h1>
    <Head>
      <title>CV Page</title>
    </Head>
    <div>
      <Link href='/main'>
        <a>Main</a>
      </Link>
    </div>
  </div>
);
